import { useState, useRef, useEffect } from "react";

export default function SongCard({ song, onAddToPlaylist }) {
  const [isPlaying, setIsPlaying] = useState(false);
  const [currentTime, setCurrentTime] = useState(0);
  const [duration, setDuration] = useState(0);
  const [playbackRate, setPlaybackRate] = useState(1);
  const audioRef = useRef(null);

  // Play / Pause toggle
  const togglePlay = () => {
    if (isPlaying) {
      audioRef.current.pause();
    } else {
      audioRef.current.play();
    }
    setIsPlaying(!isPlaying);
  };

  // Update current time
  const handleTimeUpdate = () => setCurrentTime(audioRef.current.currentTime);

  // Set duration when loaded
  const handleLoadedMetadata = () => setDuration(audioRef.current.duration);

  // Handle progress bar change
  const handleProgressChange = (e) => {
    audioRef.current.currentTime = e.target.value;
    setCurrentTime(e.target.value);
  };

  // Handle playback speed change
  const handleSpeedChange = (e) => {
    audioRef.current.playbackRate = e.target.value;
    setPlaybackRate(e.target.value);
  };

  // Format time in mm:ss
  const formatTime = (time) => {
    const minutes = Math.floor(time / 60);
    const seconds = Math.floor(time % 60);
    return `${minutes}:${seconds < 10 ? "0" + seconds : seconds}`;
  };

  return (
    <div className="song-card" style={{ border: "1px solid #ccc", padding: "1rem", borderRadius: "10px", width: "250px", margin: "1rem" }}>
      <img src={song.cover} alt={song.title} style={{ width: "100%", borderRadius: "10px", marginBottom: "0.5rem" }} />
      <h3 style={{ margin: "0.2rem 0" }}>{song.title}</h3>
      <p style={{ margin: "0.2rem 0", fontSize: "0.9rem", color: "#555" }}>
        {song.artist} | {song.language} | {song.duration}
      </p>

      <audio
        ref={audioRef}
        src={song.url}
        onTimeUpdate={handleTimeUpdate}
        onLoadedMetadata={handleLoadedMetadata}
        onEnded={() => setIsPlaying(false)}
        style={{ width: "100%", marginBottom: "0.5rem" }}
      />

      {/* Timeline / Progress Bar */}
      <div style={{ display: "flex", alignItems: "center", marginBottom: "0.5rem" }}>
        <span>{formatTime(currentTime)}</span>
        <input
          type="range"
          min="0"
          max={duration}
          value={currentTime}
          onChange={handleProgressChange}
          style={{ flex: 1, margin: "0 0.5rem" }}
        />
        <span>{formatTime(duration)}</span>
      </div>

      {/* Controls */}
      <div style={{ marginBottom: "0.5rem" }}>
        <button onClick={togglePlay} style={{ padding: "0.3rem 0.8rem" }}>
          {isPlaying ? "Pause" : "Play"}
        </button>
        <button onClick={() => onAddToPlaylist(song)} style={{ padding: "0.3rem 0.8rem", marginLeft: "0.5rem" }}>
          Add to Playlist
        </button>
      </div>

      {/* Playback Speed */}
      <div>
        <label htmlFor="speed">Speed: </label>
        <select id="speed" value={playbackRate} onChange={handleSpeedChange}>
          <option value="0.5">0.5x</option>
          <option value="0.75">0.75x</option>
          <option value="1">1x</option>
          <option value="1.25">1.25x</option>
          <option value="1.5">1.5x</option>
          <option value="2">2x</option>
        </select>
      </div>
    </div>
  );
}
